package frontweb.vo;

public class JobAvgSal {
	private String job;
	private double avgsal;
	public JobAvgSal() {
		// TODO Auto-generated constructor stub
	}
	public JobAvgSal(String job, double avgsal) {
		this.job = job;
		this.avgsal = avgsal;
	}
	public String getJob() {
		return job;
	}
	public void setJob(String job) {
		this.job = job;
	}
	public double getAvgsal() {
		return avgsal;
	}
	public void setAvgsal(double avgsal) {
		this.avgsal = avgsal;
	}
	
}
